// Function with Optional Parameters
function farewell(name: string, farewell?: string): string {
    return `${farewell || 'Goodbye'}, ${name}!`;
}

// Function with Default Parameters
function multiply(a: number, b: number, c: number): number {
    return a * b * c;
}

// Arrow Function
const add = (a: number, b: number): number => a + b;

// Function with Rest Parameters
function sum(...numbers: number[]): number {
    return numbers.reduce((acc, curr) => acc + curr, 0);
}

// Function with Union Types
function format(input: string | number): string {
    if (typeof input === 'number') {
        return input.toFixed(2);
    }
    return input.trim();
}

// Function with Generics
function identity<T>(arg: T): T {
    return arg;
}

// Example usage
console.log(farewell("Alice")); // Output: Hello, Alice!
console.log(farewell("Bob", "Hi")); // Output: Hi, Bob!
console.log(multiply(5, 1, 3)); // Output: 15
console.log(multiply(5, 2, 4)); // Output: 40
console.log(add(3, 4)); // Output: 7
console.log(sum(1, 2, 3, 4, 5)); // Output: 15
console.log(format(123.456)); // Output: 123.46
console.log(format("  Hello World  ")); // Output: Hello World
console.log(identity<number>(42)); // Output: 42
console.log(identity<string>("TypeScript")); // Output: TypeScript
